-- Migration 088: Set icons for securities with names containing specified pattern
-- Description: Update icon field for securities where name contains a user-defined string
-- 
-- INSTRUCTIONS FOR USE:
-- 1. Choose one of the examples below or create your own UPDATE statement
-- 2. Replace the search pattern and base64 icon data with your values
-- 3. Uncomment the chosen UPDATE statement
-- 4. Apply the migration

BEGIN;

-- VOLATILITY SHARES
UPDATE securities 
SET icon = 'data:image/png;base64,'
WHERE UPPER(name) LIKE '%Volatility Shares%' 
  AND name IS NOT NULL;

-- Vanguard
UPDATE securities 
SET icon = 'data:image/png;base64,'
WHERE UPPER(name) LIKE '%Vanguard%'
AND UPPER(name) LIKE '%ETF%'
AND name IS NOT NULL;

-- SPDR
UPDATE securities 
SET icon = 'data:image/png;base64,'
WHERE UPPER(name) LIKE '%SPDR%'
AND name IS NOT NULL;

